import React from 'react';
import AppLayout from '../components/AppLayout';
import Head from 'next/head';

const Profile = () => {
  return(
    <>
      <Head>
        <meta charSet="utf-8"/>
        <title> 내 프로필 | NodeBird </title>
      </Head>
      <AppLayout>
        <NicknameEditForm/>
        <FollowList header="팔로잉 목록"/>
        <FollowList header="팔로워 목록"/>
      </AppLayout>
    </>
  )
}

export default Profile;
